  const [genres,setGenres] = useState([]);
  const [count, setCount] = useState(0);
  const [genresObj, setGenresObj] = useState({
    "action": [],
    "comedy": [],
    "drama": [],
    "fantasy": [],
    "horror": [],
    "mystery": [],
    "romance": []
  })
  const movieList = useRef()

  useEffect(() => {
    axios.get("http://localhost:8888/genres").then((response)=>{
      console.log("response data1:", response.data);
      setGenres(response.data);
    });
  },[]);
  useEffect(() => {
    if(genres.length>0 && count<3) {
      // const newGenresObj = {...genresObj};
      const newGenresObj = Object.assign({},genresObj);
      console.log("New Obj");
      genres.forEach((genres)=>{
        console.log("genres movies: ", genres);
        axios.get(`http://localhost:8888/movies/genres/${genres.name}`).then((response)=>{
            newGenresObj[genres.name] = response.data;
            console.log("genres name:", genres.name);
            console.log("response data2:", response.data);
            console.log("genresObj old: ", genresObj);
            console.log("genresObj", newGenresObj);
            setGenresObj(newGenresObj);
            setCount(count+1);
            console.log("count:", count);
          })
      });
    }
  },[genres,genresObj,count])

  const getPrev = ()=>{
    const styles = getComputedStyle(movieList.current);
    const movieListLeft = styles.left;
    const leftValue = parseInt(movieListLeft);
    console.log("leftValue: ", leftValue);
    movieList.current.style.left = leftValue - 243 + "px";
    const children = movieList.current.children;
    console.log("children: ", children.length); //8
    // if(leftValue < 243){
    //   movieList.current.style.left = 0;

    // }else {
    // }
  }
  const getNext = ()=>{
    const styles = getComputedStyle(movieList.current);
    const movieListLeft = styles.left;
    const leftValue = parseInt(movieListLeft);
    movieList.current.left = leftValue - 243 + "px";
    // if(leftValue < 243){
    //   movieList.current.left = 0;
    // }else {
    //   movieList.current.left = leftValue + 243 + "px";
    // }
  }

  return (
    <div className="movie-container">
      <div className="genres clearfix">
        <div className="genres-name">action</div>
        <ul ref={movieList}>
          <li className="movie-list">
            <img src={require(`../../images/coco.png`)} alt="movie-pic" />
            <div>coco</div>                  
          </li>
          <li className="movie-list">
            <img src={require(`../../images/coco.png`)} alt="movie-pic" />
            <div>coco</div>                  
          </li>
          <li className="movie-list">
            <img src={require(`../../images/coco.png`)} alt="movie-pic" />
            <div>coco</div>                  
          </li>
          <li className="movie-list">
            <img src={require(`../../images/coco.png`)} alt="movie-pic" />
            <div>coco</div>                  
          </li>
          <li className="movie-list">
            <img src={require(`../../images/coco.png`)} alt="movie-pic" />
            <div>coco</div>                  
          </li>
          <li className="movie-list">
            <img src={require(`../../images/coco.png`)} alt="movie-pic" />
            <div>coco</div>                  
          </li>
          <li className="movie-list">
            <img src={require(`../../images/coco.png`)} alt="movie-pic" />
            <div>coco</div>                  
          </li>
          <li className="movie-list">
            <img src={require(`../../images/coco.png`)} alt="movie-pic" />
            <div>coco</div>                  
          </li>
        </ul>
        <div className="pre-arrow arrow" onClick={getPrev}>
          <img src={require(`../../images/arrow.jpeg`)} alt="movie-pic" />
        </div>
        <div className="post-arrow arrow" onClick={getNext}>
          <img src={require(`../../images/arrow.jpeg`)} alt="movie-pic" />
        </div>
      </div>
      {/* {
        genres.length>0 && genres.map((genres)=>{
          return <div className="genres clearfix" key={genres.id}>
            {
              genresObj[genres.name].length>0 ? 
              <div className="genres-name">{genres.name}</div> :
              null
            }
